package Operators;

public class differenceArithmeticOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 10;
		int b = 20;
		
		System.out.println("Difference of a and b: " + (a - b));
		System.out.println("Difference of a and b: " + (b - a));

	}

}
